import React from 'react';
import { BrowserRouter as Router, Route} from "react-router-dom";

import './App.css';
import Navbar from "./navbar";
import Home from "./homepage";

function App() {
  return (
    <Router>
        <Navbar />
        <Route exact path="/" component={Home} />
    </Router>
  );
}
export default App;
